import React from "react";
import './Main.css'

const Main = () => {
    const [state, setState] = React.useState([
        {
            title: 'Geely',
            img: 'https://450517.selcdn.ru/antcar/images/L78fdilsFK/medium/L78fdilsFK.jpg',
            price: '23,000'
        }
    ]);

    return (
        <div className="category">
            {state.map((item, index) => (
                <div key={index} className="item">
                    <img className="img" width='100%' src={item.img} alt={item.title} />
                    <span className="title">{item.title}</span>
                    <p>1.5 л / 181 л.с. / Бензин</p>
                    <p>{item.price}</p>
                    <span className="link" onClick={() => window.location.href = 'https://www.google.com/search?sca_esv=575482934&rlz=1C5CHFA_enAZ1061AZ1061&tbs=lf:1,lf_ui:2&tbm=lcl&sxsrf=AM9HkKkbEqQdIRqZNBUo1dtfVUo3Mcyxzw:1697916634386&q=metro+park&rflfq=1&num=10&ved=2ahUKEwj85uau8IeCAxVNiP0HHTIYCpgQtgN6BAgVEAI#rlfi=hd:;si:;mv:[[40.41645059907908,49.91059770892335],[40.398248891602286,49.8668240578003]]'}>
                        Подробнее
                    </span>
                </div>
            ))}
        </div>
    );
}

export default Main;
